import React from "react";
import { Link } from "react-router-dom"; // Ensure you've installed react-router-dom

const Header = () => {
  return (
    <header
      style={{
        display: "flex",
        justifyContent: "space-between",
        alignItems: "center",
        padding: "10px",
      }}
    >
      <h1>Best Airways</h1>
      <Link to="/login">
        <button>Login</button>
      </Link>
    </header>
  );
};

export default Header;
